import axios from 'axios'


const CAMION_API_BASE_URL = 'http://localhost:8080/api/v1/camiones'

import { getTokens } from '@/components/Token.vue';

class CamionService {
  async getCamiones() {
    try {
      // Obtener un token llamando al método "getTokens" importado
      const token = await getTokens();

      // Llamar al método "getCamiones" del servicio de camión, pasando el token como un parámetro
      const response = await axios.get(CAMION_API_BASE_URL, {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      return response.data;
    } catch (error) {
      throw error;
    }
  }
}

export default new CamionService();
